package com.example.dodo.geologistica;import com.google.android.gms.maps.model.LatLng;/** * Created by dodo on 22/08/16. */public class Os {    private int idOs;    private String endereco;    private String data;    private String hora;    private LatLng latLng;    public Os(int idOs, String endereco, String data, String hora){        this.idOs = idOs;        this.endereco = endereco;        this.data = data;        this.hora = hora;    }    public Os() {    }    public int getIdOs() {        return idOs;    }    public void setIdOs(int idOs) {        this.idOs = idOs;    }    public String getEndereco() {        return endereco;    }    public LatLng getLatLng() {        return latLng;    }    public void setEndereco(String endereco) {        this.endereco = endereco;    }    public String getData() {        return data;    }    public void setData(String data) {        this.data = data;    }    public String getHora() {        return hora;    }    public void setHora(String hora) {        this.hora = hora;    }    public void setLatLng(LatLng latLong) {        this.latLng = latLong;    }}